import React, { Component } from 'react';
import PropTypes from 'prop-types';
import SimpleSlider from './slider';

export default class App extends Component {
    handleChange () {
         return "hello"
    }
    render() {
        return (
        <div>
            <SimpleSlider name="Loan Amount" min={500}  max={5000} step={1} onChange={handleChange()}/>
            <SimpleSlider name="Months" min={6} max={24} step={1}/>
        </div>
        );
    }
}
